var Pokemon = function(id,name,url){
    this.id=id;
    this.name=name;
    this.url=url;
    }
    const listpokemons =[];
 const getListCurrent=  function (pokemons){
        for(var position in pokemons){
               listpokemons[position]=new Pokemon(position,pokemons[position].name,pokemons[position].url);
        }
      }

      getListCurrent(pokemons);

      for( var position in pokemons){
        console.log(listpokemons[position]);
    }

      export default getListCurrent;
